import React from 'react';
import { Link } from 'react-router-dom'; // Importamos Link para manejar la navegación interna de la aplicación

function HomePage() {
  return (
    <div>
      <h1>Welcome to Weaving Stories!</h1>
      <p>This is the home page.</p>
      {/* Botón para ir al inicio de sesión */}
      <Link to="/login">
        <button>Login</button>
      </Link>
    </div>
  );
}

export default HomePage;
